// Get all input items (your AI output should be in items[0], and label map in items[0].json.labels)
const items = $input.all();

// 1. Parse comma-separated label names returned by the AI node
let resultLabels = items[0].json.content.parts[0].text
  .split(",")
  .map((label) => label.trim())
  .filter((label) => label.length > 0);

// 2. Get the label mapping array from aggregate node (should be in items[0].json.labels)
const labelObjects = $('Aggregate').first().json.labels || [];
console.log("LABEL", labelObjects);

// 3. Map label names to IDs using the mapping array
const labelIds = resultLabels
  .map((lName) => {
    const match = labelObjects.find((obj) => obj.name === lName);
    return match ? match.id : null;
  })
  .filter(Boolean); // remove nulls

// 4. Output as n8n expects
return [
  {
    json: {
      labelIds,
    },
  },
];
